INSERT INTO `user` VALUES ('1609291632259271', '测试7', 'test7', 'test7', null, '17005710007', '$2a$04$bw117e0Lnizi1bo208.y/uYZd2jTbPzywVYuFqrdKUd3iqw/pJWfu', '2016-09-29 16:32:26', null, '2016-09-29 16:32:26', '1', '1', '0', '0', null, '1', 'test7zfb', 'test7wx', null, '浙江漳州', 'img/avatar/1609291632259271.jpeg', '1996-01-01', '香港Play Statio公布了最新的VR宣传片，与“锤哥”克里斯·海姆斯沃斯傻傻分不清楚的徐锦江终于如愿cos雷神，只是这金毛、金属银上衣和神似地毯的红色斗篷看上去实在有点山寨。徐锦江之所以COS雷神，是早前有网友过微博晒出香港演员徐锦江撞脸雷神的PS照片。随后徐锦江还发微博说：“终于找到了比我还像自己的人！雷神先生，看来我们的替身快要失业了！我们马上就要拥有了彼此代替对方的第二职业”。', '牛逼就行了', '董事长', '0', '0');
